import {useState, useEffect} from 'react'

useEffect(() => {
    fetch(`../logements.json`)
         .then((response) => response.json()
         .then(({ logements }) => console.log(logements))
         .catch((error) => console.log(error))
     )
 }, [])

 function Card() {

 }

 export default Card
